import React from 'react';
import { Container, Anchor } from 'react-bootstrap';
//import './styles.css'

function Cabecalho() {
  
  return (
        <Container>
          <Anchor  href="/paginas/home">Home</Anchor>
          <Anchor  href="/paginas/contatos">Contatos</Anchor>
          <Anchor href="/paginas/intranet">Intranet</Anchor>
        </Container>
         
  );
}

export default Cabecalho;
